import React, { useEffect, useState } from "react";
import api from "../api";
import ProjectCard from "./ProjectCard";

const staticProjects = [
  {
    title: "Currency Converter",
    description: "A React app to convert currencies using real-time API.",
    demo: "https://amruthakalyan.github.io/currency-converter_react/",
    repo: "https://github.com/amruthakalyan/currency-converter_react",
  },
  {
    title: "Image Search",
    description: "Search and browse images using Unsplash API.",
    demo: "https://amruthakalyan.github.io/imagesearch_react/",
    repo: "https://github.com/amruthakalyan/imagesearch_react",
  },
  {
    title: "Jokes Generator",
    description: "Fetch random jokes with a click.",
    demo: "https://amruthakalyan.github.io/JokesGenerator_react/",
    repo: "https://github.com/amruthakalyan/JokesGenerator_react",
  },
  {
    title: "Hotstar Clone",
    description: "A simple clone of Hotstar built with React.",
    demo: "https://amruthakalyan.github.io/hotstar-clone/",
    repo: "https://github.com/amruthakalyan/hotstar-clone",
  },
  {
    title: "Tic Tac Toe",
    description: "Classic tic tac toe game built using React.",
    demo: "https://amruthakalyan.github.io/tictactoe/",
    repo: "https://github.com/amruthakalyan/tictactoe",
  },
  {
    title: "Web Clone",
    description: "A simple website clone project.",
    demo: "https://amruthakalyan.github.io/webclone/",
    repo: "https://github.com/amruthakalyan/webclone",
  },
  {
    title: "Calculator",
    description: "A basic calculator made using React.",
    demo: "https://amruthakalyan.github.io/calculator/",
    repo: "https://github.com/amruthakalyan/calculator",
  },
  {
    title: "Quiz App",
    description: "Interactive quiz app built with React.",
    demo: "https://amruthakalyan.github.io/Quiz/",
    repo: "https://github.com/amruthakalyan/Quiz",
  },
  {
    title: "Random Number Generator",
    description: "Generates random numbers with ease.",
    demo: "https://amruthakalyan.github.io/RandomNumberGenerator/",
    repo: "https://github.com/amruthakalyan/RandomNumberGenerator",
  },
  {
    title: "Portfolio Website",
    description: "Personal portfolio showcasing my projects and skills.",
    demo: "https://amruthakalyan.github.io/personal-portfolio/",
    repo: "https://github.com/amruthakalyan/personal-portfolio",
  },
  {
    title: "Text Utils",
    description: "Word counter and text utilities app built with React.",
    demo: "https://amruthakalyan.github.io/word-counter/",
    repo: "https://github.com/amruthakalyan/word-counter",
  },
  {
    title: "Weather App",
    description: "A weather forecasting app using open API.",
    demo: "https://amruthakalyan.github.io/weather-App/",
    repo: "https://github.com/amruthakalyan/weather-App",
  },
  {
    title: "Alarm App",
    description: "Set alarms directly in the browser.",
    demo: "https://amruthakalyan.github.io/alarm/",
    repo: "https://github.com/amruthakalyan/alarm",
  },
  {
    title: "Age Calculator",
    description: "Calculate age from birth date easily.",
    demo: "https://amruthakalyan.github.io/Age-calculator",
    repo: "https://github.com/amruthakalyan/Age-calculator",
  },
  {
    title: "Typing Speed Test",
    description: "Check typing speed with this React app.",
    demo: "https://amruthakalyan.github.io/TypingSpeed-Test/",
    repo: "https://github.com/amruthakalyan/TypingSpeed-Test",
  },
  {
    title: "Snake Game",
    description: "Classic snake game built with JavaScript.",
    demo: "https://amruthakalyan.github.io/SnakeGame/",
    repo: "https://github.com/amruthakalyan/SnakeGame",
  },
  {
    title: "Used Car Price Prediction (Decision Tree)",
    description: "ML model to predict used car prices using Decision Tree Regressor.",
    demo: "https://github.com/amruthakalyan/Used_Car_Price_Prediction_Project-DecisionTreeRegressor-",
    repo: "https://github.com/amruthakalyan/Used_Car_Price_Prediction_Project-DecisionTreeRegressor-",
  },
  {
    title: "Boston House Price Prediction",
    description: "Predict Boston house prices using ML regression techniques.",
    demo: "https://github.com/amruthakalyan/Boston_House_Price_Prediction",
    repo: "https://github.com/amruthakalyan/Boston_House_Price_Prediction",
  },
  {
    title: "Iris Flower Classification",
    description: "ML project to classify iris flowers dataset.",
    demo: "https://github.com/amruthakalyan/Iris_dataset",
    repo: "https://github.com/amruthakalyan/Iris_dataset",
  },
  {
    title: "Random Forest Project",
    description: "ML project using Random Forest for classification.",
    demo: "https://github.com/amruthakalyan/Random_Forest",
    repo: "https://github.com/amruthakalyan/Random_Forest",
  },
  {
    title: "Titanic Survival Prediction",
    description: "Predict passenger survival on Titanic dataset using ML.",
    demo: "https://github.com/amruthakalyan/Titanic_Survival_Project",
    repo: "https://github.com/amruthakalyan/Titanic_Survival_Project",
  },
  {
    title: "Used Car Price Prediction (Random Forest)",
    description: "Predict used car prices using Random Forest Regressor.",
    demo: "https://github.com/amruthakalyan/Used_Car_Price_Prediction_Project_RandomForest_Regressor",
    repo: "https://github.com/amruthakalyan/Used_Car_Price_Prediction_Project_RandomForest_Regressor",
  },
];

export default function Projects() {
  const [projects, setProjects] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    api
      .get("/projects")
      .then((r) => {
        if (r.data && r.data.length > 0) {
          setProjects(r.data);
        } else {
          setProjects(staticProjects);
        }
        setLoading(false);
      })
      .catch(() => {
        setProjects(staticProjects);
        setLoading(false);
      });
  }, []);

  return (
    <section id="projects" className="portfolio">
      <h1>Projects</h1>
      <p>Explore my work with live demos and GitHub repositories.</p>

      {loading ? (
        <p>Loading...</p>
      ) : (
        <div className="projects-grid">
          {projects.map((p, i) => (
            <ProjectCard
              key={p._id || i}
              title={p.title}
              description={p.description}
              demo={p.demo}
              repo={p.repo}
            />
          ))}
        </div>
      )}
    </section>
  );
}
